package springproject.restperson.models.entities;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import org.hibernate.envers.Audited;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "locations")@Setter@Getter@NoArgsConstructor@AllArgsConstructor@Auditedpublic class Location extends Base {    @Column(name = "denomination")    private String denomination;}